import React,{useState,useEffect} from 'react';
import './offer.css'


import  axios  from "axios";
import Container from '../../../../Container.jsx';

function Offer() {
  const [ProductData,setproductData] = useState([])
  const section1Products = ProductData.slice(0, 8);
  useEffect(() => {
     axios.get("https://66d6dd72006bfbe2e64ee358.mockapi.io/user/Products")
     .then(res => setproductData(res.data))
     .catch(err => console.log(err.message))
          console.log(ProductData);

  },[]);
  return (
<div className="offer">
<div className="product">
     <h3>Categories </h3>
     <h1>Our Products</h1>
     <Container>
     <div className="productrows">

           {section1Products.map(item => (
             <div key={item.id} className='productitem'>
                 <div className="categoryName">
                          <p>{item.product.categoryname}</p>
                 </div>

                 <img src={item.product.img} alt={item.product.name} />

                 <h2>{item.product.name}</h2>
                 <hr/>
                 <div className="productitembootom">

                   <p>Price: ${item.product.price}</p>
                 </div>


             </div>
           ))}
             <div className="btn">
             <button>Load more</button>
             </div>
     </div>
     </Container>
  </div>
</div>
  );
}

export default Offer;
